function ascii_to_hex(str)
  {
	var arr1 = [];
	for (var n = 0, l = str.length; n < l; n ++) 
     {
		var hex = Number(str.charCodeAt(n)).toString(16);
		arr1.push(hex);
	 }
	return arr1.join('');
   }

   function hexToBytes(hex) {
    for (var bytes = [], c = 0; c < hex.length; c += 2)
        {

            bytes.push(parseInt(hex.substr(c, 2), 16));
        }
            return bytes;
}


  
